import React from "react";

import { ResponsiveRadar } from "@nivo/radar";
const data = [
  {
    taste: "fruity",
    chardonay: 35,
    carmenere: 116,
    syrah: 24,
  },
  {
    taste: "bitter",
    chardonay: 91,
    carmenere: 84,
    syrah: 74,
  },
  {
    taste: "heavy",
    chardonay: 27,
    carmenere: 41,
    syrah: 73,
  },
  {
    taste: "strong",
    chardonay: 83,
    carmenere: 59,
    syrah: 104,
  },
  {
    taste: "sunny",
    chardonay: 62,
    carmenere: 30,
    syrah: 78,
  },
];

export default class Example {
  displayName: "RadarExample";

  render() {
    return (
      <ResponsiveRadar
        data={data}
        keys={["chardonay", "carmenere", "syrah"]}
        indexBy="taste"
        maxValue="auto"
        margin={{ top: 70, right: 80, bottom: 40, left: 80 }}
        curve="linearClosed"
        borderWidth={2}
        borderColor={{ from: "color" }}
        gridLevels={5}
        gridShape="circular"
        gridLabelOffset={36}
        enableDots={true}
        dotSize={10}
        dotColor={{ theme: "background" }}
        dotBorderWidth={2}
        dotBorderColor={{ from: "color" }}
        enableDotLabel={true}
        dotLabel="value"
        dotLabelYOffset={-12}
        colors={{ scheme: "nivo" }}
        fillOpacity={0.25}
        blendMode="multiply"
        animate={true}
        motionStiffness={90}
        motionDamping={15}
        isInteractive={true}
        legends={[
          {
            anchor: "top-left",
            direction: "column",
            translateX: -50,
            translateY: -40,
            itemWidth: 80,
            itemHeight: 20,
            itemTextColor: "#999",
            symbolSize: 12,
            symbolShape: "circle",
            effects: [
              {
                on: "hover",
                style: {
                  itemTextColor: "#000",
                },
              },
            ],
          },
        ]}
      />
    );
  }
}
